import React from 'react';

import aboutme from './aboutmefinal2.png'

function About() {
    return (
        <div className="about-container">
            <div className="about-main">
                <div className="about-left">
                    <img src={aboutme}></img>
                    <h1>Piyush Maan</h1>
                </div>
            </div>
        </div>
    );
}

export default About;
